import React from 'react';
// import '../css/footer.css';
// import '../css/terms.css';

import { Feature } from './Links';
import { FreshFav } from './FooterSocial';
import { ShapeShift } from './Terms';
import { TakingOff } from './Links';
import { Diversity } from './FooterSocial';
import { Creative } from './Terms';
import { HomeStretch } from './Links';
import { More } from './FooterSocial';
import { Terms } from './Terms';
import { Links } from './Links';
import { FooterSocial } from './FooterSocial';

export class Main extends React.Component {
	render() {
		return (
			<div className="footer-contents">
				<div>
					<Links />
				</div>

				<div>
					<FooterSocial />
				</div>

				<div>
					<Terms />
				</div>
			</div>
		);
	}
}
